const Inmueble = (titulo, imagen, subtitulo) => {
    return (
        <div className='inmueble'>
        <h1> {titulo} </h1>
        <p>{props.subtitulo}</p>
        <img src={props.imagenInmueble}></img>
        <br></br>
        <a href='/'>Comprar</a>
    </div> 
    )
}

export default Inmueble
